{"query":"query {
    pools(first: 20, skip: 0, where: {publicSwap: true}) {
      id
      liquidity
      swapFee
      totalSwapVolume
      totalWeight
      totalShares
      tokensList
      tokens {
        id
        address
        balance
        decimals
        symbol
        denormWeight
      }
      shares(where: {balance_gt: 0, userAddress: ""}) {
        balance
      }
      swaps(first: 1, orderBy: "timestamp", orderDirection: "desc", where: { timestamp_lt: 1627396937 }) {
        tokenIn
        tokenInSym
        tokenAmountIn
        tokenOut
        tokenOutSym
        tokenAmountOut
        poolTotalSwapVolume
      }
    }
  }"}

{"operationName":"VisitorQuery","variables":{},"query":"query VisitorQuery {
  visitor {
    id
    isBot
    geolocation {
      country
      __typename
    }
    __typename
  }
}
"}

{"operationName":"CollectionViewerEdge","variables":{"collectionId":"4e2066c9a8fd"},"query":"query CollectionViewerEdge($collectionId: ID!) {
  collection(id: $collectionId) {
    ... on Collection {
      id
      viewerEdge {
        ...Collection_viewerEdge
        __typename
      }
      __typename
    }
    __typename
  }
}

fragment Collection_viewerEdge on CollectionViewerEdge {
  id
  canEditOwnPosts
  canEditPosts
  isEditor
  isFollowing
  isMuting
  isSubscribedToLetters
  isSubscribedToMediumNewsletter
  isSubscribedToEmails
  isWriter
  __typename
}
"}

{"operationName":"UserViewerEdge","variables":{"userId":"fb8c6a84cb7f"},"query":"query UserViewerEdge($userId: ID!) {
