fragment User_viewerEdge on UserViewerEdge {
  id
  createdAt
  hasCompletedProfile
  isAllowEdsEnabled
  isBlocking
  isFollowing
  isMuting
  isFacebookFollowing
  isMediumFollowing
  isSuperFollowing
  isTwitterFollowing
  isUser
  lastPostCreatedAt
  readPostsCount
  __typename
}
"}

